暖かいフードウォーマー<br>
首元から顔や頭・耳まで保護するので<br>
スノーボードなどのアウトドアや普段使いまで<br>
様々な用途でご使用頂けます。<br>
<br>
■厚めのフリース<br>
頭部分はフリース素材で触り心地がよく暖かい！<br>
<br>
■かわいい柄<br>
キャラクターや柄があり可愛いです。<br>
<br>
■伸縮性抜群<br>
伸縮性があり、装着も楽に行なえます。<br>
<br>
素材：フリース、ポリエステル<br>
サイズ：フリーサイズ<br>
対象年齢：4～12才<br>
重量(約)：80g<br>
製造国：中国<br>
<br>
※乳児、幼児のご使用はおやめください。<br>
※輸入商品の為、若干作りが荒い部分がございます。<br>
※こちらの商品はメール便発送にて送料無料です。<br>
※ゆうメールでの発送は（ポスト投函）代金引換、日付指定はできませんのでご了承ください。<br>
※仕様は改善の為に予告なく変更する場合があります。<br><style>
