メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
【chieky02】chieky （チキー）LEDキッズライト(サッカー)<br>
<br>
目に優しい、カッコ良くてボーイッシュなLED卓上ライト。<br>
あありそうでなかった、子供用のLEDライトが登場！<br>
今までは、手の届かなかったLEDがやっと子供達の手元にやってきました。<br>
専用の特殊LED光源で、他に類をみないコンパクトさ。<br>
フレキシブルアームで自由自在な角度調整。<br>
お子様用なので、複雑な仕様はいっさいございません。<br>
自分で簡単スイッチON。やる気と集中力を引き出します。<br>
家庭用コンセントに、本体に付属しているコードを差し込むだけで設置簡単。<br>
LEDライトなので省電力で長寿命とってもエコ！<br>
消費電力はたったの4Wで、電気代を気にせずに長時間使えます。<br>
普段の明かりにプラスして、子供達の手元を照らせば集中力UP!<br>
<br>
<br>
【特徴】<br>
・目に優しいLED。<br>
・フレキシブルアームで自由自在な角度調整可能。<br>
・ON/OFFスイッチの簡単操作。<br>
・省エネ、長寿命なLEDチップ使用。<br>
・消費電力は約4W。<br>
・特殊設計のLEDライト採用。<br>
・持ち運び便利な軽量設計。<br>
・手を挟んだり、引っかけ防止の角丸デザイン。ヒンジ等も使用しておりません。<br>
<br>
ON/OFFスイッチのみ、簡単操作のLED卓上ライト。<br>
光源にはLEDを採用！<br>
広範囲を自然に照らすので、目に優しく疲れにくい光になっています。<br>
チラつき等によって起こされる目の疲れを軽減。<br>
<br>
白熱灯や蛍光灯と比べて低発熱で、紫外線や遠赤外線が少ないという特性があり、<br>
室内温度への影響や、照射面での火傷のリスクがほとんどない安心仕様。<br>
物の劣化焼け等も軽減され、虫もよりにくくなっています。<br>
お子さまのお部屋等でも安心してお使いいただけます。<br>
<br>
フレキシブルアームで角度調整は自由自在！<br>
場所を選ばない自由度の高さが嬉しいLEDライトです。<br>
<br>
シンプルでやさしい楕円型のセードとサッカーボールの形をしたベースがお部屋の雰囲気を盛り上げます！<br>
イエロー×ブラックのビタミンカラーも魅力的。<br>
重さは約760gなのでお子様一人でも持ち運び簡単です。<br>
<br>
安心設計＆安心価格＆安心保障（１年保証）<br>
３つの安心を約束！<br>
<br>
<br>
規格<br>
サイズ：最大約H280×W260×D200mm<br>
定格電圧：100V <br>
調光：なし<br>
光色：昼白色<br>
光束：約500lm<br>
消費電力：約4W <br>
電源コード：約１.1ｍ<br>
重さ：約760g<br>
